etty much anywhere in the Southwest. Andrew\'s work has been featured in The One Show, Communication Arts, Print and PDN. His clients have included Southwest Airlines, BMW, the US Air Force, Costa Del Mar, Williams-Sonoma, Yeti and many more.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In addition to shooting multiple advertising campaigns for both print and broadcast, Andrew was the DP on five documentaries, including Man on a Mission: Richard Garriott\'s Road to the Stars, the 2010 SXSW doc winner.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Andrew shoots with a Sony FX6 and FX3 system, is a registered FAA drone operator, and has a small G&amp;E and basic audio package, so he can scale from being part of a large production to pretty much doing it all solo.</p>\n<!-- /wp:paragraph -->','On Set','','publish','closed','closed','','bio','','','2022-12-30 20:35:12','2022-12-30 20:35:12','',0,'https://andrewyates.com/?page_id=34',0,'page','',0),(35,1,'2022-04-27 16:10:27','2022-04-27 16:10:27','{\"version\": 2, \"isGlobalStylesUserThemeJSON\": true }','Custom Styles','','publish','closed','closed','','wp-global-styles-insideoutcreative','','','2022-04-27 16:10:27','2022-04-27 16:10:27','',0,'https://andrewyates.com/index.php/2022/04/27/wp-global-styles-insideoutcreative/',0,'wp_global_styles','',0),(36,1,'2022-04-27 16:12:01','2022-04-27 16:12:01','','Logo-Andrew-Yates','','inherit','open','closed','','logo-andrew-yates','','','2022-04-27 16:12:05','2022-04-27 16:12:05','',0,'https://andrewyates.com/wp-content/uploads/2022/04/Logo-Andrew-Yates.png',0,'attachment','image/png',0),(38,1,'2022-04-27 16:33:25','2022-04-27 16:33:25','','Andrew-Yates-Stills-HCB_Health','','inherit','open','closed','','andrew-yates-stills-hcb_health','','','2022-04-27 16:56:58','2022-04-27 16:56:58','',2,'https://andrewyates.com/wp-content/uploads/2022/04/Andrew-Yates-Stills-HCB_Health.jpg',0,'attachment','image/jpeg',0),(39,1,'2022-04-27 16:33:27','2022-04-27 16:33:27