drewyates/?p=204',0,'revision','',0),(205,1,'2022-12-30 18:53:42','2022-12-30 18:53:42','','Still Pictures Moving','','inherit','closed','closed','','2-revision-v1','','','2022-12-30 18:53:42','2022-12-30 18:53:42','',2,'http://localhost:8888/andrewyates/?p=205',0,'revision','',0),(206,1,'2022-12-30 20:42:26','2022-12-30 20:42:26','<!-- wp:heading {\"level\":1,\"className\":\"bold text-accent\"} -->\n<h1 class=\"bold text-accent\">Solo Documentary</h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>I was commissioned by Cid‚Äôs Food Store in Taos, NM to film a series of mini-docs about their local artisanal farmers and producers. Cid‚Äôs is a really great natural food store - think Whole Foods way back when it was cool. In addition to providing a viable outlet - other than farmers\' markets - for local farmers to see their wares, Cid‚Äôs acts as something of a regional business incubator: If you grow or make something that they consider suitable for sale in the store, Cid‚Äôs will help you get your stuff on the shelves, from packaging to UPC codes to pricing strategies. They‚Äôre really nice people and I really enjoyed working on this project over a period of more than two years.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Northern New Mexico and Southern Colorado have somewhat unique agricultural practices: One rarely sees sprinkler systems irrigating fields. The region has the Acequia system -basically a series of small canals - instituted in the time of the Conquistadores, and has not really changed since then. Each farm or family using acequias has water rights dating back generations, and are now regionally controlled by majordomos, the distributor and rationer of the water. Rotational grazing and organic farming are also widely practised, and there is a general communal spirit of helping your neighbour and not trashing the land</p>\n<!-- /wp:paragraph -->','Solo Documentary','','publish','closed','closed','','solo-documentary','','','2022-12-3